%[text] # EE580 Data Generation & Filtering
%[text] ## Input Signals
%[text] "In Matlab, generate two signals, x1\[n\] and x2\[n\], of 900 float elements each. The samples in a signal are the 9 digits in your student number, repeated 100 times. For example, if the first student number is "201338959", the first signal is x1\[n\]=\[2, 0, 1, 3, 3, 8, 9, 5, 9, 2, 0, 1, 3, 3, 8, 9, 5, 9, 2, 0, 1, 3, 3, 8, 9, 5, 9, â€¦\]. Signal x2\[n\] will be generated using the second student number. From each signal, subtract its mean value, so that the resulting signal has a mean equal to zero. "
reg1 = [2 0 2 1 1 8 8 7 4];
reg2 = [2 0 2 1 1 4 6 4 2]; % Placeholder

x1 = repmat(reg1,1,100);
x2 = repmat(reg2,1,100);

% Subtracting mean so zero centered
x1 = x1 - mean(x1);
x2 = x2 - mean(x2);
%[text] ## Sampling Frequecy
%[text] The sampling frequency to be used is equal to the rounded mean between the values identified by the last four digits in both student numbers. For example, if the first student number is "201338959" and the second student number is "201343242", the sampling frequency to be used is round((8959+3242)/2)=6101Hz. In those cases where the sampling frequency results in being less than 1000Hz, then 1000Hz should be added to it. 
reg1_last4 = str2double(sprintf("%d",reg1(end-3:end)));
reg2_last4 = str2double(sprintf("%d",reg2(end-3:end)));
fs = round( ( reg1_last4 + reg2_last4 )/2 ) %[output:49b6c631]

if (fs < 1000) 
    fs = fs + 1000;
end
%[text] ## Plot Signals
%[text] "In Matlab, plot time graphs of 3 cycles (3 x 9 samples = 27 samples) of each of the two signals generated; also plot frequency graphs of the two signals (using all 900 samples available for each), using 1024 points for the FFT. All plots should be fully and correctly labelled. "
t = (1:27)/fs;



% https://uk.mathworks.com/matlabcentral/answers/499823-one-common-xlabel-and-ylabel-for-multiple-subplots
fig = figure; %[output:0c7f0ec0]
subplot(2,1,1) %[output:0c7f0ec0]
plot(t.*1e3,x1(1:length(t)), "DisplayName", "Student 1" ); %[output:0c7f0ec0]
legend %[output:0c7f0ec0]

subplot(2,1,2) %[output:0c7f0ec0]
plot(t.*1e3,x2(1:length(t)), "DisplayName", "Student 2" ); %[output:0c7f0ec0]
legend %[output:0c7f0ec0]

han=axes(fig,'visible','off');  %[output:0c7f0ec0]
han.Title.Visible='on'; %[output:0c7f0ec0]
han.XLabel.Visible='on'; %[output:0c7f0ec0]
han.YLabel.Visible='on'; %[output:0c7f0ec0]
ylabel(han,'Amplitude'); %[output:0c7f0ec0]
xlabel(han,'Time (ms)'); %[output:0c7f0ec0]
title(han,'Input Signal Time Domain'); %[output:0c7f0ec0]

X1 = fft(x1,1024);
X1_power = 10*log10(abs(X1(1:1024/2)).^2);

X2 = fft(x2,1024);
X2_power = 10*log10(abs(X2(1:1024/2)).^2);

F = (fs/1024)*(0:1024/2-1);




fig = figure; %[output:01619043]

subplot(2,1,1) %[output:01619043]
X1_plt = plot(F,10*log10(abs(X1(1:1024/2)).^2), "DisplayName", "Student 1" ); %[output:01619043]
legend %[output:01619043]
ylim([-50,75]) %[output:01619043]
[X1_pkval,X1_pkidx] = max(X1_power,[],"all");
X1_pkfreq = F(X1_pkidx) %[output:1c4dbbeb]
X1_pktip = datatip(X1_plt,'DataIndex',X1_pkidx,'Location','northwest'); %[output:01619043]
X1_plt.DataTipTemplate.DataTipRows(1) = dataTipTextRow("P",X1_power); %[output:01619043]
X1_plt.DataTipTemplate.DataTipRows(2) = dataTipTextRow("f",F); %[output:01619043]


subplot(2,1,2) %[output:01619043]
X2_plt = plot(F,10*log10(abs(X2(1:1024/2)).^2), "DisplayName", "Student 2" ); %[output:01619043]
legend %[output:01619043]
ylim([-50,75]) %[output:01619043]
% Both have the same frequency peak
% Selecting second highest for second signal
[X2_pkvals, X2_pklocs] = findpeaks(X2_power,"MinPeakDistance",100,"MinPeakProminence",40);
X2_pkval = X2_pkvals(2);
X2_pkidx = X2_pklocs(2);
X2_pkfreq = F(X2_pkidx) %[output:4bb21c07]

X2_pktip = datatip(X2_plt,'DataIndex',X2_pkidx,'Location','northwest'); %[output:01619043]
X2_plt.DataTipTemplate.DataTipRows(1) = dataTipTextRow("P",X2_power); %[output:01619043]
X2_plt.DataTipTemplate.DataTipRows(2) = dataTipTextRow("f",F); %[output:01619043]


han=axes(fig,'visible','off');  %[output:01619043]
han.Title.Visible='on'; %[output:01619043]
han.XLabel.Visible='on'; %[output:01619043]
han.YLabel.Visible='on'; %[output:01619043]
ylabel(han,'Power (dB)'); %[output:01619043]
xlabel(han,'Frequency (Hz)'); %[output:01619043]
title(han,'Input Signal Frequency Response'); %[output:01619043]
% Zooming in to peaks

fig = figure; %[output:887e7789]

subplot(2,1,1) %[output:887e7789]
X1_plt = plot(F,10*log10(abs(X1(1:1024/2)).^2), "DisplayName", "Student 1" ); %[output:887e7789]
legend %[output:887e7789]
ylim([0,X1_pkval*1.1]) %[output:887e7789]
xlim([X1_pkfreq-100,X1_pkfreq+100]) %[output:887e7789]

subplot(2,1,2) %[output:887e7789]
X2_plt = plot(F,10*log10(abs(X2(1:1024/2)).^2), "DisplayName", "Student 2" ); %[output:887e7789]
legend %[output:887e7789]
ylim([-10,X2_pkval*1.1]) %[output:887e7789]
xlim([X2_pkfreq-100,X2_pkfreq+100]) %[output:887e7789]

han=axes(fig,'visible','off');  %[output:887e7789]
han.Title.Visible='on'; %[output:887e7789]
han.XLabel.Visible='on'; %[output:887e7789]
han.YLabel.Visible='on'; %[output:887e7789]
ylabel(han,'Power (dB)'); %[output:887e7789]
xlabel(han,'Frequency (Hz)'); %[output:887e7789]
title(han,'Frequency Response @ Relevant Peaks'); %[output:887e7789]
