title("Poles and Zeros of Filter 2 @ Unit Circle") %[output:5f61ba01]
xlim([-1.5,1.5]) %[output:5f61ba01]
ylim([-1.5,1.5]) %[output:5f61ba01]
%%
%[text] ## Filtering The Signal
y1 = filter(h1,1,x1);
y2 = filter(h2,1,x2);


fig = figure; %[output:3d4abc43]
